import React from 'react'
import "../css/Footer.css";

const Footer = () => {
  return (
    <footer>
        <div className="f_left"><h6>Terms</h6><h6>Privacy</h6></div>
        <div className="f_right">Copyright 2023</div>

    </footer>
  )
}

export default Footer;
